INSERT INTO `el_qu_answer` VALUES ('1664584674678169602', '1664584674548146178', 0, '', 'Nowadays more and more people choose to live an environ-mentally friendly lifestyle. They tend to produce less rubbish in their daily life and try to recycle anything that can be reused. Some even become enthusiasts and encourage more people around them to change their lifestyles into the more environ-mentally friendly ones. Simon, one of my best friends, is a typical youngster who lives an environmentally friendly lifestyle. He tries not to buy prod-ucts during the manufacture of which much pollution may be caused. After using up the goods he bought, he would always reuse the packages of the goods for other purposes. He also tries to reduce the pollution from human-made machines. No matter in very hot summer or in freezing cold winter, he never uses air conditioners. He believes that it does us good to stay in a natural environment and reducing the use of air condition-ers can save more electricity as well. As people\'s awareness of protecting and guarding the earth becomes stronger,an increasing number of people from differ-ent fields will join to live sustainably and eventually make the world a more worthy place to live.', '');
INSERT INTO `el_qu_answer` VALUES ('1664588237408043010', '1664588237278019585', 0, '', 'It is a truth universally acknowledged that we are living in a constantly changing world. What seemed absolutely right yesterday may prove wrong today. Therefore, it is essential for everyone to keep learning new skills, so they can keep up with the pace of modern world. This mentality counts in almost every stage of our life.First, when a student keeps learning new skills, he/she always asks for more and desires to explore the unknown world. Therefore, there is an excellent chance that he/she stands out in peer groups. Second, in the workplace,office workers with such attitude generally finish his/her tasks in a higher quality, and they are more likely to climb up the ladder more quickly than their colleagues who content themselves with the skills they already have.Besides, in our daily life, people who keep learning new skills are more positive, and everyone around them must be fond of making friends with them. In all, we must keep learning new skills so as to adapt to the fast-changing world. On the one hand, we should make friends more with people who have such attitude, and let their positive energy influence us. On the other, we should bear in mind that what remains unchanged is change itself, so we should never stop learning new skills.', '');
